  const bool success = wasm_rt_allocate_memory(&(sbx->w2c_memory), 17, max_pages);
  if (!success) { return false; }
  
  LOAD_DATA(sbx->w2c_memory, 1048576u, data_segment_data_0, 180);
  LOAD_DATA(sbx->w2c_memory, 1048760u, data_segment_data_1, 116);
